import {
  Box,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
} from "@material-ui/core";
import React from "react";

export default function Order() {
  return (
    <Box
      className="body-admin m-0 pt-5 px-3 bgr-admin"
      sx={{ minHeight: "100vh" }}
    >
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>ID</TableCell>
            <TableCell>Name</TableCell>
            <TableCell>List Order</TableCell>
          </TableRow>
        </TableHead>
        <TableBody></TableBody>
      </Table>
    </Box>
  );
}
